import {LOG_IN, LOG_OUT} from "../actions/types";

const INITIAL_STATE = {};

function user(state = INITIAL_STATE, action) {
    switch (action.type) {
      case LOG_IN:
          console.log(action)
        return {...state,
            'access_token': action.payload
        };

      case LOG_OUT:
        return { ...INITIAL_STATE };

      default:
        return state;
    }
  }

  export default user;
